import React from "react";
import Title from "../Title/Title";
import { useState } from "react";
import './History.css';

const History = ()=>{
   const dummy = [
    {
        title : "Cash" , 
        
    }
   ]
   const [historyArry , sethistory]=useState([]);
   return (
      <div className="history">
        <Title value="History"/>
        <ul>
           <li>{historyArry}</li>
        </ul>
      </div>
   );
}

export default History;
